IF OBJECT_ID('dbo.ContentfulImport') IS NULL
CREATE TABLE dbo.ContentfulImport (
                                      Id INT IDENTITY(1,1) PRIMARY KEY,
                                      ContentType NVARCHAR(50),
                                      JsonResponse NVARCHAR(MAX),
                                      ImportedAt DATETIME2 DEFAULT SYSUTCDATETIME()
);

DELETE FROM dbo.ContentfulImport;

-- Required SET options for XML decoding
SET ANSI_WARNINGS ON;
SET ANSI_PADDING ON;
SET ANSI_NULLS ON;
SET QUOTED_IDENTIFIER ON;
SET CONCAT_NULL_YIELDS_NULL ON;

-- Insert JSON payloads (Base64 encoded)
INSERT INTO dbo.ContentfulImport (ContentType, JsonResponse)
VALUES (
           'section',
           CAST(
               CAST(N'' AS XML).value('xs:base64Binary("")', 'VARBINARY(MAX)')
               AS VARCHAR(MAX) -- interpret as UTF-8
  )
       );

INSERT INTO dbo.ContentfulImport (ContentType, JsonResponse)
VALUES (
           'question',
           CAST(
               CAST(N'' AS XML).value('xs:base64Binary("")', 'VARBINARY(MAX)')
               AS VARCHAR(MAX) -- interpret as UTF-8
  )
       );

INSERT INTO dbo.ContentfulImport (ContentType, JsonResponse)
VALUES (
           'answer',
           CAST(
               CAST(N'' AS XML).value('xs:base64Binary("")', 'VARBINARY(MAX)')
               AS VARCHAR(MAX) -- interpret as UTF-8
  )
       );

INSERT INTO dbo.ContentfulImport (ContentType, JsonResponse)
VALUES (
