-- =========================
-- Create migration tables
-- =========================

IF NOT EXISTS (SELECT * FROM sys.schemas WHERE name = 'migration')
    EXEC('CREATE SCHEMA migration;');

IF OBJECT_ID('migration.sections', 'U') IS NOT NULL DROP TABLE migration.sections;
CREATE TABLE migration.sections (
                                    contentfulRef NVARCHAR(100),
                                    internalName NVARCHAR(200),
                                    name NVARCHAR(MAX),
                                    shortDescription NVARCHAR(MAX),
                                    interstitialPage NVARCHAR(200),
                                    questionRefs NVARCHAR(MAX),
                                    recommendationRefs NVARCHAR(MAX)
);

IF OBJECT_ID('migration.sectionRecommendations', 'U') IS NOT NULL DROP TABLE migration.sectionRecommendations;
CREATE TABLE migration.sectionRecommendations (
                                                  sectionRef NVARCHAR(100),
                                                  recommendationRef NVARCHAR(100)
);

IF OBJECT_ID('migration.questions') IS NOT NULL DROP TABLE migration.questions;
CREATE TABLE migration.questions (
                                     contentfulRef NVARCHAR(100),
                                     internalName NVARCHAR(200),
                                     questionText NVARCHAR(MAX),
                                     helpText NVARCHAR(MAX),
                                     slug NVARCHAR(200),
                                     answerRefs NVARCHAR(MAX)
);

IF OBJECT_ID('migration.questionAnswers') IS NOT NULL DROP TABLE migration.questionAnswers;
CREATE TABLE migration.questionAnswers (
                                           questionRef NVARCHAR(100),
                                           answerRef NVARCHAR(100)
);

IF OBJECT_ID('migration.answers') IS NOT NULL DROP TABLE migration.answers;
CREATE TABLE migration.answers (
                                   contentfulRef NVARCHAR(100),
                                   internalName NVARCHAR(200),
                                   answerText NVARCHAR(MAX),
                                   nextQuestionRef NVARCHAR(MAX)
);

IF OBJECT_ID('migration.recommendationChunks') IS NOT NULL DROP TABLE migration.recommendationChunks;
CREATE TABLE migration.recommendationChunks (
                                                contentfulRef NVARCHAR(100),
                                                internalName NVARCHAR(200),
                                                header NVARCHAR(500),
                                                questionContentfulRef NVARCHAR(500),
                                                completingAnswerRefs NVARCHAR(MAX),
                                                inProgressAnswerRefs NVARCHAR(MAX)
);

IF OBJECT_ID('migration.recommendationAnswerStatuses') IS NOT NULL DROP TABLE migration.recommendationAnswerStatuses;
CREATE TABLE migration.recommendationAnswerStatuses (
                                                        recommendationRef NVARCHAR(100),
                                                        answerRef NVARCHAR(100),
                                                        recommendationStatus NVARCHAR(100)
);


GO

DECLARE @json NVARCHAR(MAX);

-- =========================
-- Parse Sections
-- =========================
SELECT TOP 1
    @json = CAST(JsonResponse COLLATE Latin1_General_100_CI_AS_SC_UTF8 AS NVARCHAR(MAX))
FROM dbo.ContentfulImport
WHERE ContentType = 'section'
ORDER BY ImportedAt DESC;

SET ANSI_WARNINGS OFF;

INSERT INTO migration.sections (contentfulRef, internalName, name, shortDescription, interstitialPage, questionRefs, recommendationRefs)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS contentfulRef,
    MAX(CASE WHEN f.[key] = 'internalName' THEN f.value END) AS internalName,
    MAX(CASE WHEN f.[key] = 'name' THEN f.value END) AS name,
    MAX(CASE WHEN f.[key] = 'shortDescription' THEN f.value END) AS shortDescription,
    MAX(CASE WHEN f.[key] = 'interstitialPage' THEN f.value END) AS interstitialPage,
    STRING_AGG(CAST(JSON_VALUE(q.[value], '$.sys.id') AS NVARCHAR(MAX)), ',') AS questionRefs,
    STRING_AGG(CAST(JSON_VALUE(cr.[value], '$.sys.id') AS NVARCHAR(MAX)), ',') AS recommendationRefs
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields') f
OUTER APPLY OPENJSON(i.[value], '$.fields.questions') q
OUTER APPLY OPENJSON(i.[value], '$.fields.coreRecommendations') cr
GROUP BY JSON_VALUE(i.[value], '$.sys.id');

INSERT INTO migration.sectionRecommendations (sectionRef, recommendationRef)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS sectionRef,
    JSON_VALUE(cr.[value], '$.sys.id') AS recommendationRef
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields.coreRecommendations') cr;

SET ANSI_WARNINGS ON;

-- =========================
-- Parse Questions
-- =========================
SELECT TOP 1
    @json = CAST(JsonResponse COLLATE Latin1_General_100_CI_AS_SC_UTF8 AS NVARCHAR(MAX))
FROM dbo.ContentfulImport
WHERE ContentType = 'question'
ORDER BY ImportedAt DESC;

SET ANSI_WARNINGS OFF;

INSERT INTO migration.questions (contentfulRef, internalName, questionText, helpText, slug, answerRefs)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS contentfulRef,
    MAX(CASE WHEN f.[key] = 'internalName' THEN f.value END) AS internalName,
    MAX(CASE WHEN f.[key] = 'text' THEN f.value END) AS questionText,
    MAX(CASE WHEN f.[key] = 'helpText' THEN f.value END) AS helpText,
    MAX(CASE WHEN f.[key] = 'slug' THEN f.value END) AS slug,
    STRING_AGG(JSON_VALUE(ans.[value], '$.sys.id'), ',') AS answerRefs
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields') f
OUTER APPLY OPENJSON(i.[value], '$.fields.answers') ans
GROUP BY JSON_VALUE(i.[value], '$.sys.id');

INSERT INTO migration.questionAnswers (questionRef, answerRef)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS questionRef,
    JSON_VALUE(ans.[value], '$.sys.id') AS answerRef
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields.answers') ans;

SET ANSI_WARNINGS ON;

-- =========================
-- Parse Answers
-- =========================
SELECT TOP 1
    @json = CAST(JsonResponse COLLATE Latin1_General_100_CI_AS_SC_UTF8 AS NVARCHAR(MAX))
FROM dbo.ContentfulImport
WHERE ContentType = 'answer'
ORDER BY ImportedAt DESC;

SET ANSI_WARNINGS OFF;

INSERT INTO migration.answers (contentfulRef, internalName, answerText, nextQuestionRef)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS contentfulRef,
    MAX(CASE WHEN f.[key] = 'internalName' THEN f.value END) AS internalName,
    MAX(CASE WHEN f.[key] = 'text' THEN f.value END) AS answerText,
    MAX(CASE WHEN f.[key] = 'nextQuestion' THEN JSON_VALUE(f.value, '$.sys.id') END) AS nextQuestionRef
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields') f
GROUP BY JSON_VALUE(i.[value], '$.sys.id');

SET ANSI_WARNINGS ON;

-- =========================
-- Parse Recommendations
-- =========================
SELECT TOP 1
    @json = CAST(JsonResponse COLLATE Latin1_General_100_CI_AS_SC_UTF8 AS NVARCHAR(MAX))
FROM dbo.ContentfulImport
WHERE ContentType = 'recommendationChunk'
ORDER BY ImportedAt DESC;

SET ANSI_WARNINGS OFF;

INSERT INTO migration.recommendationChunks (contentfulRef, internalName, header, questionContentfulRef, completingAnswerRefs, inProgressAnswerRefs)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS contentfulRef,
    MAX(CASE WHEN f.[key] = 'internalName' THEN f.value END) AS internalName,
    MAX(CASE WHEN f.[key] = 'header' THEN f.value END) AS header,
    MAX(CASE WHEN f.[key] = 'question' THEN JSON_VALUE(f.value, '$.sys.id') END) AS questionContentfulRef,
    STRING_AGG(JSON_VALUE(completingAnswers.[value], '$.sys.id'), ',') AS completingAnswerRefs,
    STRING_AGG(JSON_VALUE(inProgressAnswers.[value], '$.sys.id'), ',') AS inProgressAnswerRefs
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields') f
OUTER APPLY OPENJSON(i.[value], '$.fields.completingAnswers') completingAnswers
OUTER APPLY OPENJSON(i.[value], '$.fields.inProgressAnswers') inProgressAnswers
GROUP BY JSON_VALUE(i.[value], '$.sys.id');

INSERT INTO migration.recommendationAnswerStatuses (recommendationRef, answerRef, recommendationStatus)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS recommendationRef,
    JSON_VALUE(completingAnswers.[value], '$.sys.id') AS answerRef,
    'Complete' AS recommendationStatus
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields.completingAnswers') completingAnswers;

INSERT INTO migration.recommendationAnswerStatuses (recommendationRef, answerRef, recommendationStatus)
SELECT
    JSON_VALUE(i.[value], '$.sys.id') AS recommendationRef,
    JSON_VALUE(inProgressAnswers.[value], '$.sys.id') AS answerRef,
    'InProgress' AS recommendationStatus
FROM OPENJSON(@json, '$.items') i
    CROSS APPLY OPENJSON(i.[value], '$.fields.inProgressAnswers') inProgressAnswers;

UPDATE
    migration.questions
SET
    internalName = REPLACE(internalName, N'â€™', N'’'),
    questionText = REPLACE(questionText, N'â€™', N'’'),
    helpText = REPLACE(helpText, N'â€™', N'’')

UPDATE
    migration.answers
SET
    internalName = REPLACE(internalName, N'â€™', N'’'),
    answerText = REPLACE(answerText, N'â€™', N'’')

UPDATE
    migration.recommendationChunks
SET
    internalName = REPLACE(internalName, N'â€™', N'’'),
    header = REPLACE(header, N'â€™', N'’')


    SET ANSI_WARNINGS ON;
